            if (getSingleShipmentShipmentOptions.PrintDepartmentOption.IsSet)
                writer.WriteString("printDepartment", getSingleShipmentShipmentOptions.PrintDepartment);

            if (getSingleShipmentShipmentOptions.PrintInvoiceNumberOption.IsSet)
                writer.WriteString("printInvoiceNumber", getSingleShipmentShipmentOptions.PrintInvoiceNumber);

            if (getSingleShipmentShipmentOptions.PrintPONumberOption.IsSet)
                writer.WriteString("printPONumber", getSingleShipmentShipmentOptions.PrintPONumber);

            if (getSingleShipmentShipmentOptions.ShipperIdOption.IsSet)
                writer.WriteString("shipperId", getSingleShipmentShipmentOptions.ShipperId);

            if (getSingleShipmentShipmentOptions.MinimalAddressValidationOption.IsSet)
                writer.WriteBoolean("minimalAddressValidation", getSingleShipmentShipmentOptions.MinimalAddressValidationOption.Value!.Value);

            if (getSingleShipmentShipmentOptions.BookingConfirmationNumberOption.IsSet)
                writer.WriteString("bookingConfirmationNumber", getSingleShipmentShipmentOptions.BookingConfirmationNumber);

            if (getSingleShipmentShipmentOptions.BillingWeightOption.IsSet)
                writer.WriteString("billingWeight", getSingleShipmentShipmentOptions.BillingWeight);
        }
    }
}
